       You've Ever Seen</a>: <strong>Life Expectancy vs. Fertility Rate</strong>. </p>
  
<p>As we discussed in class, Professor Rosling tested his students at the <a href='https://ki.se/en/startpage'>Karolinska Institute</a>, an elite medical university.  He found they consistently and systematically came to the wrong conclusions 
 because they had a mistaken understanding of the world. (So did some of you)! </p>

<blockquote>
That flawed understanding: the West vs. the Rest.
</blockquote> " )),
                             
                             tags$div(
                               HTML("<p>To quote from Rosling's <a href='https://www.ted.com/talks/hans_rosling_shows_the_best_stats_you_ve_ever_seen/transcript'>talk</a>: </p>
<ul>
<li>Students:  <em>The world is still 'we' and 'them.' And 'we' is Western world and 'them' is Third World.</em> </li>
<li>Rosling: <em>And what do you mean with Western world?</em> </li>
<li>Students: <em>Well, that's long life and small family, and Third World is short life and large family.</em></li>
</ul>

<p>But as <strong>Life Expectancy vs. Fertility Rate</strong> illustrates, and Professor Rosling's work proves, this world-view  of <em>the West vs. the Rest</em> no longer applies to 21st century. For a more in-depth discussion of the same, please read the book by Rosling, 
Rönnlund, and Rosling (2018): <a href ='https://www.gapminder.org/factfulness-book/'>Factfulness: Ten Reasons We're Wrong About the World--and Why Things Are Better Than You Think</a>.
</p> 

