<p>For example, make believe the imaginary nation of Luxnebel has a GDP of 1 trillion Euros and a population of 20 million. The raw per captia GDP is 50000 Euros per person. But per capita GDP figures are usually stated in US dollars (USD). If the exchange rate is 1.5 Euros to 1 USD (year A), per capita GDP equals 75000 USD.  If 0.75 Euros to 1 USD (year B), the per capita GDP equals 37500 USD. </p>

<p>For our purposes of comparison, this does not present a problem so long as the dollar year is applied consistently. The reported per capita change over time (year to year, in this case) will still correctly indicate both direction and scale.</p> <p>Otherwise, I note the conservative GDP estimates (and hence, per capita GDP estimates) as a matter of interest. </p> ")# close HTML 
