             ##
             # SERVER
             server <- function(input, output, session){
               # Function to plot trends
               
               
               output$info <- renderPrint({ 
                 yaxis <- switch(input$dropdown, 
                                 "Life Expectancy" = "life_exp",
                                 "Infant Mortality" = "infant_mort",
                                 "Fertility" = "fert",
                                 "Per Capita GDP" = "GDPperCap" )
                 
                 print(yaxis)
                 
               })
               
      
        
               plot_trends <- function(){
                 gapminder %>% 
                   filter(region %in% input$Regions  & 
                            year %in% c(input$year_range[1]:input$year_range[2]) ) 
                 
                 
                }
               ###
               output$plot_Regions <- plotly::renderPlotly({
                 
                 yaxis <- switch(input$dropdown, 
                                 "Life Expectancy" = "life_exp",
                                 "Infant Mortality" = "infant_mort",
                                 "Fertility" = "fert",
                                 "Per Capita GDP" = "GDPperCap")
                 
                 if (yaxis == "life_exp") {
                   hold <- plot_trends() %>%
                     ggplot(aes(x = year, y = life_exp, col = country) ) +
                     geom_point(size = 0.75)   +
                     facet_grid(~region) +  theme(legend.position = "none") +
                     labs(title = "Average Life Expectancy " , x = "&nbsp;\n Years Selected" , 
                          y = "" ) 
                   
                   ggplotly(hold) 
                 }
                 
                 else if (yaxis == "GDPperCap") {
                   hold <- plot_trends() %>%
                     ggplot(aes(x = year, y = GDPperCap, col = country) ) +
                     geom_point(size = 0.75)   +
                     facet_grid(~region) +  theme(legend.position = "none") +
                     scale_y_log10() + 
                     labs(title = "Per Capita GDP (Log Scale)" , 
                          x = "&nbsp;\n Years Selected" , y = "" ) 
                   
                   ggplotly(hold)
                 }
                 
                 else if (yaxis == "fert") {
                   hold <- plot_trends() %>%
                     ggplot(aes(x = year, y = fert, col = country) ) +
                     geom_point(size = 0.75)   +
                     facet_grid(~region) +  theme(legend.position = "none") +
                     scale_y_log10() + 
                     labs(title = "Fertility Rate" , 
                          x = "&nbsp;\n Years Selected" , y = "" ) 
                   
                   ggplotly(hold)
                   
                 }
                 else {
                   hold <- plot_trends() %>%
                     ggplot(aes(x = year, y = infant_mort, col = country) ) +
                     geom_point(size = 0.75)   + 
                     facet_grid(~region)  + theme(legend.position = "none") +
                     labs(title = "Infant Morality Rate (per 1000)" , 
                          x = "&nbsp;\n Years Selected" , y = "" ) 
                   
                   ggplotly(hold)   
                 }
                 
                 ##
               })
               
               output$table_Regions <- DT::renderDT({
                 td <- plot_trends() %>% 
                   select(region,country:fert, GDPperCap) 
                 DT::datatable({td}, options = list(
                   pageLength = 10)) 
               })
               
               output$countryList <- DT::renderDT({
                 country_list <- gapminder %>% 
                   group_by(region, continent) %>% 
                   distinct(country) %>% 
                   arrange(continent, region, country) %>% select(country, region, continent)
                 
                 DT::datatable({country_list},options = list(
                   pageLength = 5))
               })
               
               output$mymap <- renderLeaflet({
                 leaflet() %>%
                   addProviderTiles(providers$Esri.WorldTopoMap,
                                    options = providerTileOptions(noWrap = TRUE)) %>%
                   addMarkers(lng = 116.633, lat = 23.415,
                              popup = "Shantou University") %>%      
                   setView(38.9202328, 37.2232149, zoom = 4) %>%
                   addMarkers(lng = 38.9202328, lat = 37.2232149,
                              popup = "Gobekli Tepe") %>%
                   addMarkers(lng =  -72.545556, lat = -13.163333, 
                              popup = "Machu Picchu")
               

               })
               output$hans_rosling <- plotly::renderPlotly({
                 
  #               even_years <- seq(1972, 2012, by = 2)
                 
  #               hans <- gapminder %>% filter(year %in% even_years) %>%
  #                 filter(year >= 1972 & year <= 2012) %>%
  #                 plot_ly(x = ~fert, y = ~life_exp, text =~country) %>%
  #                 add_markers(frame = ~year, ids = ~country, 
  #                             color = ~continent, showlegend = TRUE) %>%
  #                 layout(xaxis = list(title = "Fertility Rate"),
  #                        yaxis = list(title = "Life Expectancy"),
  #                        title = "Life Expectancy vs. Fertility Rate")
                 
                 hans 
               })
             }
             
             shinyApp(ui = ui, server = server)